import React, { useEffect } from "react";
import { Svg_Line_Graph } from "../utils/svg-linegraph";

function LineGraph({ data, selectedItem }) {
  useEffect(() => {
    Svg_Line_Graph({ data, selectedItem });
  }, [data, selectedItem]);

  return <div id="line_graph"></div>;
}

export default LineGraph;
